import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Hero from "./pages/HeroPage";

function Router() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/">
          <Hero />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default Router;
